import React from "react";

import Card from "./Components/Card";
import Ldata from "./Components/Ldata";
console.log(Ldata[0].img)
function App() {
    return (
        <>
            <div className="cards">
                <img src="./" alt="" />
                <Card images={Ldata[0].img} title={Ldata[0].title} type={Ldata[0].type} />
                <Card images={Ldata[1].img} title={Ldata[1].title} type={Ldata[1].type} />
                <Card images={Ldata[2].img} title={Ldata[2].title} type={Ldata[2].type} />
            </div>
        </>
    )
};


export default App;
